import React, { Component } from 'react';
import searchResultUser from './Component/searchResultUser';

class searchUser extends Component {
    constructor(props) {
      super(props);
      this.state = {
        searchKeyword:""
      };
    }
    render() {
      return(
        <div>
          <h1>dfg</h1>
          {searchResultUser}
        </div>
      );
    }
  }
    
export default searchUser
